import React,{ useState, useEffect } from "react";
import YandexMap from "./Map/YandexMap";
import { AutoComplete } from 'antd';
import axios from "axios";

type MyObjectType = Record<string, unknown>;
export default function Test() {
    const [address, setAddress] = useState('');
    const [options, setOptions] = useState<MyObjectType[]>([]);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const suggestions = await suggestFunction();
                setOptions(suggestions);
            } catch (error) {
                console.error("Error fetching suggestions:", error);
            }
        };

        fetchData(); // Call the async function within the useEffect
    }, []); // Empty dependency array means this effect runs once after the initial render

    return (
        <>
            <AutoComplete  placeholder="input here" options={options}/>
            <input type='text' className='border-2 border-solid'/>
            <YandexMap/>
        </>
    );
}



